  let navigate = useNavigate();

  return (

    <button onClick={() => {

      console.log(favorite.name);
      console.log(favorite);
      <DisplayFavorites favorite={favorite?.name} />
      navigate("/favorites")
    }}>Add to Favorites List</button>

  )
};

export default FavoritesButton
